inline Vector3f GGX_SPTD_fit_lookup(float cos_theta, float roughness) {
    float u = roughness;
    int ui = int(u * GGX_SPTD_fit_roughness_sample_count);
    float v = 2.0f * acosf(cos_theta) / 3.14159f;
    int vi = int(v * GGX_SPTD_fit_angular_sample_count);
    return GGX_SPTD_fit[vi + ui * GGX_SPTD_fit_angular_sample_count];
}

